import Home from "../components/Home";

export const data = [
    {
        id: 1,
        path: '/',
        title: "Home",
        Component: <Home />,
        hidden: true,
    },
    {
        id: 1,
        path: '/about',
        title: "About",
        Component: <h1>About</h1>
    },
    {
        id: 2,
        path: '/contact',
        title: "Contact",
        Component: <h1>Contact</h1>
    },
    {
        id: 3,
        path: '/products',
        title: "Products",
        Component: <h1>Products</h1>
    },
    {
        id: 4,
        path: '/adress',
        title: "Adress",
        Component: <h1>Adress</h1>
    },
    {
        id: 5,
        path: '/empty-class',
        title: "Empty Class",
        Component: <h1>Empty class</h1>,
        child: true,
        children: [
            {
                id: 6,
                path: '/adress',
                title: "Ord",
                Component: <h1>Adress</h1>
            },
            {
                id: 7,
                path: '/adress',
                title: "Adress",
                Component: <h1>Adress</h1>
            },
        ]
    },
]
